import React, { component } from 'react';
import 'list.css' ;
import PropTypes from 'prop-types';

class Note extends Component{
    constructor(props){
        super(props);
        this.message = "hello from note component"
    }

    render(props){
        return(
            <div>
                <h1>{this.message}</h1>
            </div>
        )
    }
}
